description:
Désignation commerciale et adresse postale des débits de tabac en activité en France métropolitaine en 2018.
**Avertissements** : 
  * Les informations sont le reflet de la saisie effectuée dans les bases de données de la douane. 
  * N’ayant pas de caractère obligatoire, certaines données peuvent ne pas être présentes : Enseigne / Numéro et libellé de voie / Complément. 
  * En colonne « Complément » figure parfois le terme générique « TABAC » . 
**Description du contenu**
Le jeu de données contient les informations suivantes: 
  * ID = numéro de ligne; 
  * Enseigne = nom du commerce; 
  * Adresse = indication principale de l’adresse;
  * Complément = complément de dénomination ou d'information pour une meilleure localisation (ex: centre commercial); 
  * Code postal; 
  * Commune; 
  * Nature du débit de tabac : ordinaire permanent / ordinaire saisonnier / spécial 
    * ordinaire permanent : le débit de tabac ordinaire permanent a pour fonction de vendre au détail des tabacs manufacturés dans tous les lieux autres que ceux réservés aux débits spéciaux. Il est ouvert toute l'année.
    * ordinaire saisonnier : un débit de tabac ordinaire saisonnier a pour fonction de vendre au détail des tabacs manufacturés dans les lieux d'affluence touristique, tels que les stations balnéaires ou de montagne. La période d'ouverture est limitée à la période d'affluence touristique et pour une période annuelle d'au moins 3 mois et n'excédant pas 8 mois si le point de vente est ouvert en 2 périodes ou 6 mois en cas d'ouverture du comptoir de vente sur une seule période.
    * spécial : un débit de tabac spécial vend du tabac manufacturés au détail toute l'année, et est implanté sur le domaine public concédé du secteur des transports (gare, aéroport, port et réseau autoroutier), sur le domaine public concédé ou géré en régie (centre pénitentiaires), et dans les enceintes qui ne sont pas librement accessibles au public (musée ou parc d'attraction).

Ce jeu de données donne la liste des organisations de data.gouv.fr reliées à la base [Wikidata.org](https://www.wikidata.org/wiki/Wikidata:Main_Page). 
Les données sont en cours de consolidation et doivent être utilisées avec précaution.
A titre indicatif, le rapprochement de la liste des organisations de data.gouv.fr et Wikidata peut servir à : 
* analyser la nature des organisations (administration publique, commune, entreprise, association, etc) ;
* avoir des informations complémentaires sur ces mêmes organisations (compte Github ou Twitter par exemple) ;
* obtenir des libellés alternatifs aux libellés de data.gouv.fr ;
* afficher des liens vers la page data.gouv.fr d'une organisation depuis l'article Wikipédia correspondant ;  
* avoir une vision de la hiérarchie des organisations (savoir qu'une organisation est une filiale d'une autre).
